import React, { Component } from "react";
import Slider from "react-slick";
import styled from 'styled-components'
import girl from '../photos/girl.jpg'
import girl2 from '../photos/girl.jpg'
import girl3 from '../photos/girl.jpg'
import girl4 from '../photos/girl.jpg'
import girl5 from '../photos/girl.jpg'
import girl6 from '../photos/girl.jpg'

const Div = styled.div`
width:50px;
height:90%;
background-position:center;
background-repeat:no-repeat;
background-size:cover;
`

export default class Girls extends Component {
    render() {
        const settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 3
        };
        return (
            <div>
                <h2> Multiple items </h2>
                <Slider {...settings}>
                    <div style={{ backgroundImage: `url(${girl})` }}>
                        <p>asd</p>
                    </div>

                </Slider>
            </div >
        );
    }
}
